description:
Verenigd Koninkrijk / Duitsland / Frankrijk / Canada / Japan / Verenigde Staten
Mystery / Thriller
113 minuten

een goeie film

met Liam Neeson, Diane Kruger en January Jones

Dr. Martin Harris (Liam Neeson) ontwaakt na een auto-ongeluk in Berlijn om te ontdekken dat zijn vrouw hem niet meer herkent 
en dat een andere man zijn identiteit heeft overgenomen. Genegeerd door ongelovige autoriteiten en opgejaagd door mysterieuze 
huurmoordenaars is Martin moe en alleen. Met hulp uit onverwachte hoek begint hij een avontuur, waarbij hij gaat twijfelen aan 
zijn geestelijke gesteldheid en zijn echte identiteit. Hoe ver zal hij gaan om de waarheid te achterhalen?
